import React, {Component} from 'react';


class City extends Component {

    render() {
        return (
            < div to = {
                this.route(obj)
            }
            key = {
                    index
                } >
                <
                div className = "cityNames" > {
                    obj.cityName
                } <
                /div> <
                img src = {
                    obj.image
                }
            alt = "destinations"
            style = {
                styles
            }
            /> <
            /div>
        );
    }

}

export default City;
